import { Container } from 'reactstrap';

import HomePageCarousel from '../components/HomePageCarousel';

function Home() {
    return(
        <Container>
            <div>
                <button onClick={() => console.log("Button clicked")}>Click me</button>
                <HomePageCarousel />                
            </div>
        </Container>
    );
}

export default Home;
